templates.template:
Pages {
	Page "${pageName}" {
		model type "${fullyQualifiedModelRootClass}"
		id ${viewpointName}.${pageName_id}
		index ${pageIndex}
			
		Overview {
			image on :  "${OverviewImagePathOn}"
			image off : "${OverviewImagePathOff}"
		}
			
		header {
			image on : "${PageImagePathOn}"
			image off : "${PageImagePathOff}"
		}
		tab name  "${tabName}"
		show viewer : true
	}
}

Page "${pageName}" {
	model type "${fullyQualifiedModelRootClass}"
	id ${viewpointName}.${pageName_id}
	index ${pageIndex}
		
	Overview {
		image on :  "${OverviewImagePathOn}"
		image off : "${OverviewImagePathOff}"
	}
		
	header {
		image on : "${PageImagePathOn}"
		image off : "${PageImagePathOff}"
	}
	tab name  "${tabName}"
	show viewer : true
}

Sections {
	section "${sectionName}" {
		id ${viewpointName}.${sectionName_id}
		extended page ${extendedPageId}
		index ${sectionIndex}
		filtering : true
		expanded : false
	}
}

section "${sectionName}" {
	id ${viewpointName}.${sectionName_id}
	extended page ${extendedPageId}
	index ${sectionIndex}
	filtering : true
	expanded : false
}

Activities {
	activity "${activityName}" {
		id ${viewpointName}.${activityName_id}
		extended section ${extendedSectionId}
		index ${activityIndex}
		predicated : false
		icon : "${iconPath}"
	}
}

activity "${activityName}" {
	id ${viewpointName}.${activityName_id}
	extended section ${extendedSectionId}
	index ${activityIndex}
	predicated : false
	icon : "${iconPath}"
}
